import { formatDistanceToNowStrict, subHours, subMinutes } from 'date-fns';
import {
  Avatar,
  Box,
  Card,
  CardHeader,
  Container,
  Divider,
  IconButton,
  Link,
  List,
  ListItem,
  ListItemAvatar,
  ListItemText,
  Typography
} from '@material-ui/core';
import DotsHorizontalIcon from '../../../icons/DotsHorizontal';

const now = new Date();

const activities = [
  {
    id: '5e89140bcc768199d1e0dc49',
    createdAt: subMinutes(now, 23).getTime(),
    customer: {
      id: '5e887a62195cc5aef7e8ca5d',
      avatar: '/static/mock-images/avatars/avatar-marcus_finn.png',
      name: 'Marcus Finn'
    },
    description: 'Created account',
    type: 'register'
  },
  {
    id: '5e891411b0290b175166cd32',
    createdAt: subMinutes(now, 56).getTime(),
    customer: {
      id: '5e887ac47eed253091be10cb',
      avatar: '/static/mock-images/avatars/avatar-carson_darrin.png',
      name: 'Carson Darrin'
    },
    description: 'Subscription Purchase',
    type: 'payment'
  },
  {
    id: '5e89141633dc5e52c923ef27',
    createdAt: subHours(now, 2).getTime(),
    customer: {
      id: '5e887b209c28ac3dd97f6db5',
      avatar: '/static/mock-images/avatars/avatar-fran_perez.png',
      name: 'Fran Perez'
    },
    description: 'Submitted a ticket',
    type: 'ticket_create'
  },
  {
    id: '5e89141bd975c7f33aee9f4b',
    createdAt: subMinutes(now, 5).getTime(),
    customer: {
      id: '5e887b7602bdbc4dbb234b27',
      avatar: '/static/mock-images/avatars/avatar-jie_yan_song.png',
      name: 'Jie Yan Song'
    },
    description: 'Subscription Purchase',
    type: 'payment'
  },
  {
    id: '5e891421d7945778863cf9ca',
    createdAt: subMinutes(now, 5).getTime(),
    customer: {
      id: '5e86809283e28b96d2d38537',
      avatar: '/static/mock-images/avatars/avatar-jane_rotanson.png',
      name: 'Jane Rotanson'
    },
    description: 'Subscription Purchase',
    type: 'payment'
  }
];

const GroupedList1 = () => (
  <Box
    sx={{
      backgroundColor: 'background.default',
      p: 3
    }}
  >
    <Container maxWidth="sm">
      <Card>
        <CardHeader
          action={(
            <IconButton>
              <DotsHorizontalIcon fontSize="small" />
            </IconButton>
          )}
          title="Activity"
        />
        <Divider />
        <Box sx={{ display: 'flex' }}>
          <Box
            sx={{
              p: 3,
              flexGrow: 1,
              '&:first-of-type': {
                borderRight: (theme) => `1px solid ${theme.palette.divider}`
              }
            }}
          >
            <Typography
              align="center"
              color="textPrimary"
              variant="h5"
            >
              15,245
            </Typography>
            <Typography
              align="center"
              color="textSecondary"
              component="h4"
              variant="overline"
            >
              Registered
            </Typography>
          </Box>
          <Box
            sx={{
              p: 3,
              flexGrow: 1,
              '&:first-of-type': {
                borderRight: (theme) => `1px solid ${theme.palette.divider}`
              }
            }}
          >
            <Typography
              align="center"
              color="textPrimary"
              variant="h5"
            >
              357
            </Typography>
            <Typography
              align="center"
              color="textSecondary"
              component="h4"
              variant="overline"
            >
              Online
            </Typography>
          </Box>
        </Box>
        <Divider />
        <List disablePadding>
          {activities.map((activity, i) => (
            <ListItem
              divider={i < activities.length - 1}
              key={activity.id}
            >
              <ListItemAvatar>
                <Avatar
                  src={activity.customer.avatar}
                  sx={{ cursor: 'pointer' }}
                />
              </ListItemAvatar>
              <ListItemText
                disableTypography
                primary={(
                  <Link
                    color="textPrimary"
                    sx={{ cursor: 'pointer' }}
                    underline="none"
                    variant="subtitle2"
                  >
                    {activity.customer.name}
                  </Link>
                )}
                secondary={(
                  <Typography
                    color="textSecondary"
                    variant="body2"
                  >
                    {activity.description}
                  </Typography>
                )}
              />
              <Typography
                color="textSecondary"
                noWrap
                variant="caption"
              >
                {formatDistanceToNowStrict(activity.createdAt)}
                {' '}
                ago
              </Typography>
            </ListItem>
          ))}
        </List>
      </Card>
    </Container>
  </Box>
);

export default GroupedList1;
